/** @jsx jsx */
import { jsx } from "theme-ui";
const API = process.env.API_URL;

const Page = () => {
    return (
        <div sx={{ height: `calc(100vh - 60px)` }}>
            <div
                sx={{
                    variant: "containers.page",
                    display: "flex",
                    alignItems: "center",
                    height: "100%",
                }}
            >
                <h1 sx={{ fontSize: 8, my: 0 }}>Welcome</h1>
            </div>
        </div>
    );
};

export default Page;
